webpackJsonp([0x7e2816bd9379],{3055:function(e,a){e.exports={data:{talkJson:{description:"With no real coding experience, I decided to sit down and teach myself to code by making one website a day, every day, for 180 days. In this session, I'll cover what inspired me to take the path of self directed learning and what challenges I faced along the way. The first websites I made were simple and only used a tiny bit of html and css. By the end I was making dynamic, interactive apps. In this talk I'll present a selection of some of my favorite websites from the project which include games, toys, physics simulations, data visualizations and real time communication apps.\n\nhttps://www.jsconfar.com/",meta:{duration:"PT22M3S"},presenter:{name:null},slug:"jennifer-de-walt-how-i-learned-to-code-by-making-180-websites-in-180-days-or-jsconfar-2014",source:{id:"QaSbL4sRff8",provider:"youtube"},tag:[],title:"Jennifer De Walt: How I learned to Code by Making 180 websites in 180 days | JSConf.ar 2014"},allTalkJson:null},pathContext:{slug:"jennifer-de-walt-how-i-learned-to-code-by-making-180-websites-in-180-days-or-jsconfar-2014",tags:[]}}}});
